import React, { Component } from 'react';
import ColorBar from 'react-color-bar';

class Bar extends Component {
    render() {
        const data = [
              {
                  value: 300,
                  color: '#21bbce',
                  legendLabel: 'interest',
                  legendValue: 300,
                  tooltip: 'interest is $300',
              }, {
                  value: 200,
                  color: '#4bc97d',
                  legendLabel: 'tax',
                  legendValue: 200,
                  tooltip: 'tax is $200',
              }, {
                  value: 100,
                  color: '#eb5be1',
                  legendLabel: 'insurance',
                  legendValue: 100,
                  tooltip: 'insurance is $100',
              },
          ];
          return (
            <div>
                <ColorBar data={data} />
            </div>
        );
    }
}

export default Bar;
